INSERT INTO `companies` (`company_id`, `company_username`, `company_password`, `company_name`, `company_slug`, `company_owner`, `company_description`, `company_date`, `company_email`, `company_phone`, `company_fax`, `company_province`, `company_district`, `company_address`, `company_location`, `company_website`, `company_logo`, `company_hours`, `company_socials`, `company_status`, `company_premium`, `company_created_date`, `company_updated_date`, `company_login_date`) VALUES
(1, 'digimas', 'sav280181', 'Digi Mas', 'digi-mas', 'Salim Milet', '<p>Uzman ekibimiz değişik&nbsp;fikirleri geniş deneyimimizle birleştiren &ccedil;arpıcı sonu&ccedil;lar sunar. M&uuml;şterilerinizle sosyal medyayı kullanarak onları markanıza &ccedil;ekerek s&uuml;rd&uuml;r&uuml;lebilir, anlamlı bir ilişki kurmanıza yardımcı olabiliriz.</p>\r\n\r\n<p>Arama motoru optimizasyonu, sosyal medya pazarlaması, e-posta pazarlaması ve dijital pazarlama gibi farklı alanlarda &ccedil;alışıyoruz.</p>\r\n', '2017', 'info@digi-mas.com', '0 (544) 740 7463', '+904621987654', 61, 2, 'Merkez: Baysal İnş. Mad. Tic. San. Ltd. Şti. Çarşı mah. Uzun sok. No : 74 / B Trabzon / TURKİYE ', '', 'http://www.digi-mas.com', '{\"img\":\"201711011509534600-657859f9ab88dcfba.png\",\"xs\":\"xs-201711011509534600-657859f9ab88dcfba.png\"}', NULL, NULL, 0, 0, '2017-11-01 11:10:12', '2017-11-02 09:34:57', NULL),
(2, 'atabassoft', '6cf72790db7111a9b5b8f71e882138ac', 'Atabaş Software', 'atabas-software', 'Furkan Atabaş', '<h2>Lorem Ipsum Nedir?</h2>\r\n\r\n<p><strong>Lorem Ipsum</strong>, dizgi ve baskı end&uuml;strisinde kullanılan mıgır metinlerdir. Lorem Ipsum, adı bilinmeyen bir matbaacının bir hurufat numune kitabı oluşturmak &uuml;zere bir yazı galerisini alarak karıştırdığı 1500&#39;lerden beri end&uuml;stri standardı sahte metinler olarak kullanılmıştır. Beşy&uuml;z yıl boyunca varlığını s&uuml;rd&uuml;rmekle kalmamış, aynı zamanda pek değişmeden elektronik dizgiye de sı&ccedil;ramıştır. 1960&#39;larda Lorem Ipsum pasajları da i&ccedil;eren Letraset yapraklarının yayınlanması ile ve yakın zamanda Aldus PageMaker gibi Lorem Ipsum s&uuml;r&uuml;mleri i&ccedil;eren masa&uuml;st&uuml; yayıncılık yazılımları ile pop&uuml;ler olmuştur.</p>\r\n\r\n<h2>Neden Kullanırız?</h2>\r\n\r\n<p>Yinelenen bir sayfa i&ccedil;eriğinin okuyucunun dikkatini dağıttığı bilinen bir ger&ccedil;ektir. Lorem Ipsum kullanmanın amacı, s&uuml;rekli &#39;buraya metin gelecek, buraya metin gelecek&#39; yazmaya kıyasla daha dengeli bir harf dağılımı sağlayarak okunurluğu artırmasıdır. Şu anda bir&ccedil;ok masa&uuml;st&uuml; yayıncılık paketi ve web sayfa d&uuml;zenleyicisi, varsayılan mıgır metinler olarak Lorem Ipsum kullanmaktadır. Ayrıca arama motorlarında &#39;lorem ipsum&#39; anahtar s&ouml;zc&uuml;kleri ile arama yapıldığında hen&uuml;z tasarım aşamasında olan &ccedil;ok sayıda site listelenir. Yıllar i&ccedil;inde, bazen kazara, bazen bilin&ccedil;li olarak (&ouml;rneğin mizah katılarak), &ccedil;eşitli s&uuml;r&uuml;mleri geliştirilmiştir.</p>\r\n', '2013', 'info@atabassoft.com', '05464348721', '04621234578', 61, 474, 'Tanjant yolunun meydana yakın bir bölgesinde kilpa ile aynı hizada trabzonda', '', 'www.atabassoft.com', '{\"img\":\"201711021509608731-258659facd1b9cd72.jpg\",\"lg\":\"lg-201711021509608731-258659facd1b9cd72.jpg\",\"md\":\"md-201711021509608731-258659facd1b9cd72.jpg\",\"xs\":\"xs-201711021509608731-258659facd1b9cd72.jpg\"}', NULL, NULL, 1, 1, '2017-11-02 07:49:38', '2017-11-02 09:32:44', NULL),
